    <form className="form-container " onSubmit={props.getWeather1}>
    <input type ="text" name="city" placeholder="City..."/>
    <input type ="text" name="country" placeholder="Country..."/>


    <span className="btn">

    <button><Button>variant="dark">Get Weather</Button></button>

    </span>

    </form>

);

export default Form;
